import React from "react";
import "./App.css";
import Header from "./components/Header";
import Game from "./components/Game";

function App() {
  return (
    <div className="App">
      <Header />
      <Game />
      <p>
        <p>Your tries: {props.count}</p>
      </p>
    </div>
  );
}

export default App;
